INSERT INTO `news_news` (`id`, `title`, `content`, `created_at`, `updated_at`, `photo`, `is_published`, `slug`, `category_id`, `content_en`, `content_uk`, `title_en`, `title_uk`) VALUES
(1, 'ZARA STUDIO ЖІНОЧИЙ/ЧОЛОВІЧИЙ: ПРОСВІТЛЕННЯ КОЖНОГО ОДЯГУ', 'Створення гармонії через дослідження явних протиріч - між прогресивним і класичним, між жіночим і чоловічим, між поверхнею і глибиною - лежить в основі останньої колекції Zara Studio. Результатом є винятковий набір\r\n\r\nодяг для жінок і чоловіків, який можна носити універсально, водночас виступаючи в якості потужної призми для передачі чіткої особистості та ідентичності окремого власника.\r\n\r\nКолекція охоплює всі фундаментальні архетипи в каноні сучасного одягу - від морського до спортивного одягу, пошиття одягу та вечірнього одягу - щоб перепрофілювати їхню функцію в 2022 році та надалі. Це досягається шляхом пом\'якшення їх архітектурного штампу\r\n\r\nархетипи, м’яко посилюючи їхні типові обсяги. За винятком мінімалістичного лінійного принта, колекція повністю позбавлена ​​будь-яких сторонніх поверхневих прикрас, а гудзики та застібки зазвичай прикриті. Натомість візуальна глибина забезпечується тканиною та\r\n\r\nматеріал, властивий їхнім дослідженим нейтральним кольорам і патині текстури в’язаних виробів і спеціально обробленої вовни.\r\n\r\nЗвільнена від застарілого контексту, колекція призначена для носіння відповідно до настрою власника, а не до вимог події. М’який, плавний пошив і точно мінімалістичний спортивний одяг виходять за межі своїх початкових функцій, що базуються на обслуговуванні, і стають шаблонами\r\n\r\nособисте вираження. Вечірній одяг для жінок з криміналістичним кроєм має делікатно відтворені деталі з рюшами, а штани покроєні з квадратною складкою на всю довжину для створення потоку та об’єму.\r\n\r\nТрикотажні вироби, як правило, розділені на горловині або подолу, щоб звільнити рухи. Уявна простота та притаманна витонченість поєднуються в колекції, яка поєднує в собі вищу елегантність і незрівнянну практичність: Zara Studio може носити будь-де.\r\n\r\nКолекція Studio, створена командою дизайнерів Zara у партнерстві з відомим креативним директором і стилістом Карлом Темплером, є найвищим вираженням спрямованого дизайну одягу, досконалості матеріалів і високої майстерності Zara. Спільна кампанія цього видання містить 26 із\r\n\r\nнайбільш захоплюючі та інтригуючі молоді моделі, що працюють сьогодні (повний список акторів нижче). Одягнені в Zara Studio, їх сфотографував Стівен Мейзел, а зняв Фаб’єн Барон – два найвидатніших у світі представники мистецького іміджмейкінгу.', '2022-10-25 09:24:04.509000', '2022-10-27 07:44:52.400000', 'photo/2022/10/25/0a67e60f43598ca9602ec44b0685.jpg', 1, 'zara-studio-womensmens-enlightenment-everywear', 1, 'The creation of harmony through the exploration of apparent contradictions - between the Progressive and that Classic, between the Feminine and Masculine, and between Surface and  Depth - is at the core of Zara’s latest Studio collection. The result is an exceptional suite of\r\n\r\nclothing for women and men that is universally wearable while also acting as a powerful prism for transmitting the distinct personality and identity of the individual wearer.\r\n\r\nThe collection embraces all of the fundamental archetypes in the canon of contemporary clothing - from maritime to sportswear via tailoring and evening - in order to repurpose their  function for 2022 and beyond. This is achieved by softening the architectural stamp of these\r\n\r\narchetypes while gently amplifying their typical volumes. With the exception of a minimalist linear print, the collection is entirely stripped of any extraneous surface decoration while buttons and fastenings are typically covered. Visual depth is instead provided via fabric and\r\n\r\nmaterial, inherent in their studiedly neutral colorways and the patina of texture in knits and specially treated wool.\r\n\r\nLiberated from outdated context, the collection is intended to be worn according to the wearer’s mood rather than the demands of an occasion. Soft, fluid tailoring and precisely minimalist sportswear transcend their original service-based functions to become templates of\r\n\r\npersonal expression. Forensically cut evening wear for women features delicately rendered ruching details while pants are cut with a full-length box pleat to create flow and volume.\r\n\r\nKnitwear is typically split at the neck or hem to liberate movement. Apparent simplicity and inherent sophistication combine in a collection that combines supreme elegance and peerless utility: Zara Studio can be worn everywhere by everyone.\r\n\r\nCreated by the Zara design team in partnership with the renowned creative director and stylist Karl Templer, the Studio collection is Zara’s highest expression of directional fashion design, material excellence and quality craftsmanship. This edition’s co-ed campaign features 26 of\r\n\r\nthe most exciting and intriguing young models working today (full cast list below). Wearing Zara Studio, they are photographed by Steven Meisel and filmed by Fabien Baron - two of the world’s greatest exponents of artistic image-making.', 'Створення гармонії через дослідження явних протиріч - між прогресивним і класичним, між жіночим і чоловічим, між поверхнею і глибиною - лежить в основі останньої колекції Zara Studio. Результатом є винятковий набір\r\n\r\nодяг для жінок і чоловіків, який можна носити універсально, водночас виступаючи в якості потужної призми для передачі чіткої особистості та ідентичності окремого власника.\r\n\r\nКолекція охоплює всі фундаментальні архетипи в каноні сучасного одягу - від морського до спортивного одягу, пошиття одягу та вечірнього одягу - щоб перепрофілювати їхню функцію в 2022 році та надалі. Це досягається шляхом пом\'якшення їх архітектурного штампу\r\n\r\nархетипи, м’яко посилюючи їхні типові обсяги. За винятком мінімалістичного лінійного принта, колекція повністю позбавлена ​​будь-яких сторонніх поверхневих прикрас, а гудзики та застібки зазвичай прикриті. Натомість візуальна глибина забезпечується тканиною та\r\n\r\nматеріал, властивий їхнім дослідженим нейтральним кольорам і патині текстури в’язаних виробів і спеціально обробленої вовни.\r\n\r\nЗвільнена від застарілого контексту, колекція призначена для носіння відповідно до настрою власника, а не до вимог події. М’який, плавний пошив і точно мінімалістичний спортивний одяг виходять за межі своїх початкових функцій, що базуються на обслуговуванні, і стають шаблонами\r\n\r\nособисте вираження. Вечірній одяг для жінок з криміналістичним кроєм має делікатно відтворені деталі з рюшами, а штани покроєні з квадратною складкою на всю довжину для створення потоку та об’єму.\r\n\r\nТрикотажні вироби, як правило, розділені на горловині або подолу, щоб звільнити рухи. Уявна простота та притаманна витонченість поєднуються в колекції, яка поєднує в собі вищу елегантність і незрівнянну практичність: Zara Studio може носити будь-де.\r\n\r\nКолекція Studio, створена командою дизайнерів Zara у партнерстві з відомим креативним директором і стилістом Карлом Темплером, є найвищим вираженням спрямованого дизайну одягу, досконалості матеріалів і високої майстерності Zara. Спільна кампанія цього видання містить 26 із\r\n\r\nнайбільш захоплюючі та інтригуючі молоді моделі, що працюють сьогодні (повний список акторів нижче). Одягнені в Zara Studio, їх сфотографував Стівен Мейзел, а зняв Фаб’єн Барон – два найвидатніших у світі представники мистецького іміджмейкінгу.', 'ZARA STUDIO WOMENS/MENS: ENLIGHTENMENT EVERYWEAR', 'ZARA STUDIO ЖІНОЧИЙ/ЧОЛОВІЧИЙ: ПРОСВІТЛЕННЯ КОЖНОГО ОДЯГУ'),
(2, 'Zara оголошує про початок співпраці зі світовою моделлю Каєю Гербер', 'З кампанією, розробленою Карлом Темплером і знятою французьким іміджмейкером Фаб’єном Бароном, колекція доступна на Zara.com і в окремих магазинах.\r\n\r\n4 жовтня під час Тижня моди в Парижі супермодель Кайя Гербер представила свою першу колекцію для Zara.\r\n\r\n«Моєю відправною точкою для цієї співпраці із Zara було запитання, чи можливо створити колекцію, у якій буде все, що вам знадобиться у вашій шафі. Якби ви подорожували й зібрали цілу колекцію, чи могла б вона задовольнити всі можливі ваші потреби? Думаю, ми цього досягли». Гербер сказав про колекцію.\r\n\r\nМістить понад 30 предметів, включаючи одяг, взуття та аксесуари, це гардероб «нової класики», що складається з позачасових силуетів і ключових предметів, перероблених, перероблених і переосмислених, щоб відповідати покупцям теперішнього часу. Гербер, яка розуміє, що її стиль узгоджується з Zara, наполягає, що вона хотіла бути інклюзивною, коли розробляла цю колекцію з брендом.\r\n\r\n«Під час розробки я думав не лише про себе. Я думав про свою маму, своїх друзів і всіх, кого я бачу навколо. Мій стиль взято з багатьох різних місць, і я не хотів створювати щось, що нікого виключає». – додав Гербер.\r\n\r\nЧерпаючи натхнення в кодах стилю 1990-х років, колекція випромінює дизайнерську впевненість, якою було проголошено це десятиліття. Хоча приглушена колірна палітра сірого, темно-синього, білого, чорного та темно-коричневого кольорів займає центральне місце, спалах кольору з подвійного деніму знімає капелюх перед Americana – із ковбойськими черевиками любовний лист до країни, де народився та виріс Гербер.\r\n\r\nКолекція також оновлює ідею «гарності» для 21 століття, те, що Гербер прагнув дослідити.\r\n\r\nЦе «нова класика», але підійдіть ближче, і ви побачите, що колекція також є розповіддю про об’єднані крайнощі, про відсутність необхідності вибирати між комфортом і відвертістю. Ви можете мати обидва.\r\n\r\nЧуттєвість тут зустрічається в нових і несподіваних місцях. Чоловіча біла сорочка оверсайз повністю відкривається ззаду, оголюючи тіло від потилиці до низу спини. Чорно-чорний атласний бюстгальтер і м’які, як хмари, шовкові піжеми підкреслюють одне одного. Кремова шовкова сукня в стилі героя має розріз до верхньої частини стегна, низька спина, а відкриті витончені бретелі сидять трохи нижче плечей. Ще одна розплавлена ​​біло-біла шовкова сукня пропонує альтернативу з довгими рукавами та приляганням до стегон із незвичайним вирізом на шиї.\r\n\r\nПара мікрошортів розрізана на поясі, підкреслюючи верхню частину стегна. Нижня частина спини проглядається крізь низько звисаючий пояс вощеної джинсової куртки – оновлений поворот до мінімалістичних кодів епохи. Дух карапуза, яким Гербер так добре відомий, відчувається в утилітарних робочих штанах кольору верблюжого кольору, а також у двобортному костюмі-двійці та чоловічих брюках, які Гербер назвав «ідеальними чорними штанами».', '2022-10-25 10:04:42.293000', '2022-10-27 07:44:19.250000', 'photo/2022/10/25/Screenshot_30_XYpERML.png', 1, 'zara-announces-launch-of-collaboration-with-global', 1, 'With a campaign styled by Karl Templer and shot by French image-maker Fabien Baron, the collection is available on Zara.com and selected stores.\r\n\r\nLaunching on 4th October, during Paris Fashion Week, supermodel Kaia Gerber debuts her first collection for Zara.\r\n\r\n“My starting point for this collaboration with Zara was to ask if it is possible to do a collection that has everything you would ever need in your closet. If you were traveling and packed an entire collection, could it cover every possible need that you had? I think we’ve achieved that.” Gerber said of the collection.\r\n\r\nFeaturing more than 30 pieces, including garments, shoes and accessories, it is a wardrobe of ‘new classics’, comprising timeless silhouettes and key pieces reworked, remodeled and reimagined to fit the customer of the now. Gerber, who recognises how her style aligns with Zara’s, insists she wanted to be inclusive when designing this collection with the brand.\r\n\r\n“I wasn\'t just thinking about myself when designing. I was thinking about my mom, my friends and everyone I see around me. My style is pulled from a lot of different places and I didn’t want to design something that excludes anyone.” Gerber added.\r\n\r\nDrawing inspiration from style codes of the 1990s, the collection emits the design confidence that decade was heralded for. Although a muted colour palette of grey, navy, white, black, and camel takes centre stage, a flash of colour from the double denim doffs its hat to Americana – with cowboy boots a love letter to the land where Gerber was born and bred.\r\n\r\nThe collection also updates the idea of ‘prettiness’ for the 21st century, something Gerber was keen to explore.\r\n\r\nThese are ‘new classics’, but step closer and you’ll see the collection is also a tale of united extremes, of not having to choose between comfort and revealing. You can have both.\r\n\r\nSensuality here is found in new and unexpected places. An oversized men’s white shirt opens completely at the back, exposing the body from the nape to the bottom of the back. A jet black satin bralette and cloud-soft silk PJs play off one another. A hero-piece cream silk dress is slit to the top of the thigh, its back falls low and open and delicate straps sit subtly below the shoulders. Another molten off-white, silk dress offers a long sleeved and thigh skimming alternative, with an unusual cut-out detail at the back of the neck.\r\n\r\nA pair of micro shorts are slashed open on the waistband, emphasising the top of the hip. The small of the back is seen through the low-hanging waistbelt of the waxed denim jacket – an updated twist on the era’s minimalist codes. The tomboy spirit for which Gerber is so well known is all over the utilitarian camel work pants, but also in the double-breasted two-piece suit and the men’s-fit slacks dubbed by Gerber “the perfect black trouser”.', 'З кампанією, розробленою Карлом Темплером і знятою французьким іміджмейкером Фаб’єном Бароном, колекція доступна на Zara.com і в окремих магазинах.\r\n\r\n4 жовтня під час Тижня моди в Парижі супермодель Кайя Гербер представила свою першу колекцію для Zara.\r\n\r\n«Моєю відправною точкою для цієї співпраці із Zara було запитання, чи можливо створити колекцію, у якій буде все, що вам знадобиться у вашій шафі. Якби ви подорожували й зібрали цілу колекцію, чи могла б вона задовольнити всі можливі ваші потреби? Думаю, ми цього досягли». Гербер сказав про колекцію.\r\n\r\nМістить понад 30 предметів, включаючи одяг, взуття та аксесуари, це гардероб «нової класики», що складається з позачасових силуетів і ключових предметів, перероблених, перероблених і переосмислених, щоб відповідати покупцям теперішнього часу. Гербер, яка розуміє, що її стиль узгоджується з Zara, наполягає, що вона хотіла бути інклюзивною, коли розробляла цю колекцію з брендом.\r\n\r\n«Під час розробки я думав не лише про себе. Я думав про свою маму, своїх друзів і всіх, кого я бачу навколо. Мій стиль взято з багатьох різних місць, і я не хотів створювати щось, що нікого виключає». – додав Гербер.\r\n\r\nЧерпаючи натхнення в кодах стилю 1990-х років, колекція випромінює дизайнерську впевненість, якою було проголошено це десятиліття. Хоча приглушена колірна палітра сірого, темно-синього, білого, чорного та темно-коричневого кольорів займає центральне місце, спалах кольору з подвійного деніму знімає капелюх перед Americana – із ковбойськими черевиками любовний лист до країни, де народився та виріс Гербер.\r\n\r\nКолекція також оновлює ідею «гарності» для 21 століття, те, що Гербер прагнув дослідити.\r\n\r\nЦе «нова класика», але підійдіть ближче, і ви побачите, що колекція також є розповіддю про об’єднані крайнощі, про відсутність необхідності вибирати між комфортом і відвертістю. Ви можете мати обидва.\r\n\r\nЧуттєвість тут зустрічається в нових і несподіваних місцях. Чоловіча біла сорочка оверсайз повністю відкривається ззаду, оголюючи тіло від потилиці до низу спини. Чорно-чорний атласний бюстгальтер і м’які, як хмари, шовкові піжеми підкреслюють одне одного. Кремова шовкова сукня в стилі героя має розріз до верхньої частини стегна, низька спина, а відкриті витончені бретелі сидять трохи нижче плечей. Ще одна розплавлена ​​біло-біла шовкова сукня пропонує альтернативу з довгими рукавами та приляганням до стегон із незвичайним вирізом на шиї.\r\n\r\nПара мікрошортів розрізана на поясі, підкреслюючи верхню частину стегна. Нижня частина спини проглядається крізь низько звисаючий пояс вощеної джинсової куртки – оновлений поворот до мінімалістичних кодів епохи. Дух карапуза, яким Гербер так добре відомий, відчувається в утилітарних робочих штанах кольору верблюжого кольору, а також у двобортному костюмі-двійці та чоловічих брюках, які Гербер назвав «ідеальними чорними штанами».', 'Zara announces launch of collaboration with global model Kaia Gerber', 'Zara оголошує про початок співпраці зі світовою моделлю Каєю Гербер'),
(3, 'ZARA ORIGINS', 'Zara Origins — це проект, спрямований на створення сучасного гардеробу. Мета полягає в тому, щоб задумати, створити та пропонувати одяг, який є нещодавно вдосконаленим архетипом свого роду, виготовленим із найкращих матеріалів і виготовленим із дотриманням високих стандартів досвіду та майстерності. Він використовує прогресивний дизайн, щоб поєднати сучасні концепції з видатною цінністю.\r\n\r\nКоли Zara Origins випустила свої перші дві колекції для зимового та літнього сезонів, проект, що постійно розвивається, був визначений цією заявою. Після двох видань, які дозволили експериментувати всередині колекції, підхід до третього видання природним чином змінився, затвердивши Zara Origins як річну пропозицію основних предметів гардеробу, які будуть доповнені обмеженою серією сезонних виробів.\r\n\r\nЩоб доповнити новий підхід, креативне агентство M/M Paris розробило абсолютно нову графічну айдентику. Це включає новий шрифт і сім символів або імаготипів, які присутні в усьому брендингу, а також на частинах колекції. Ця графіка служить візуальною системою, що класифікує нову структуру цього проекту.\r\n\r\nПротягом усього процесу розробки нової колекції вічних предметів гардеробу, яка пропонує стилі, які можна носити протягом усіх місяців, «Чотири сезони» Антоніо Вівальді стали саундтреком і джерелом натхнення для проекту. Якщо композиція Aphex Twins «Avril 14th» була мелодією для першого видання, а «Sun is Shinning» Боба Марлі — опорою для другої композиції, то для третьої колекції електронний музикант Аокі Такамаса створив саундтрек для «Autumn». У майбутньому інші сучасні виконавці переосмислюватимуть кожен сезон за допомогою музики.\r\n\r\nЩоб представити щорічну колекцію та додаткові стилі на осінь, Джеймі Хоксворт сфотографував кампанію, а Девід Сірс написав захоплюючий 11-хвилинний короткометражний фільм, дія якого відбувається в Токіо, в якому розповідається про різні покоління, у головних ролях Кадзуя Танабе, Шун Сугата та підпільний тату-майстер ТАППІ.\r\n\r\nУ цій кампанії Японія пропонує чистий, продуманий і вишукано розроблений фон, щоб підкреслити колекцію, яка була вдосконалена завдяки вивченню попередніх випусків, але все ще зберігає свої мінімальні силуети та візерунки.\r\n\r\nРозумна колірна палітра темно-синього, чорного, сірого, верблюжого та білого кольорів поєднує високоякісні тканини, зокрема шкіру, кашемір, альпаку та бавовну.\r\n\r\nПошуки цієї квінтесенції сучасної гардеробу органічно переросли в сферу товарів для дому. Zara Origins починалася як вправа, щоб знайти ідеальну білу футболку чи найчистіші джинсові штани, а тепер поєднується з не менш вишуканими предметами стилю життя, включаючи склянки, столовий посуд, аромати та халати серед більшої пропозиції.\r\n\r\nZara Origins буде доступний з 22 вересня 2022 року на Zara.com і в окремих магазинах.', '2022-10-25 10:05:35.295000', '2022-10-27 07:43:47.092000', 'photo/2022/10/25/Screenshot_31_vuW41hV.png', 1, 'zara-origins', 1, 'Zara Origins is a project focused upon building a contemporary wardrobe. The aim is to conceive, create and offer garments which are newly-refined archetypes of their kind, fabricated in the finest materials, and manufactured with high standards of expertise and craft. It harnesses progressive design to combine modern concepts with outstanding value.\r\n\r\nWhen Zara Origins launched its first two collections for the winter and summer seasons, the constantly evolving project was defined by this statement. After two editions allowing for experimentation within the collection, the approach for the third edition has evolved naturally solidifying Zara Origins as a yearlong offering of wardrobe essentials that will be supplemented with limited edition seasonal pieces.\r\n\r\nTo complement the new approach, creative agency M/M Paris has designed an entirely new graphic identity. This includes a new typeface and seven symbols or imagotypes which are present across the overall branding as well as seen on pieces of the collection. These graphics serve as a visual system categorizing the new structure of this project.\r\n\r\nThroughout the design process of the new collection of timeless wardrobe pieces that offers styles suitable to be worn across all months, Antonio Vivaldi\'s \"Four Seasons\" became the soundtrack and inspiration for the project. If Aphex Twins’ “Avril 14th” was the tune for the first edition and Bob Marley’s “Sun is Shinning” the pillar for the second offering, for the third collection electronic musician Aoki Takamasa has created the soundtrack for “Autumn”. Going forward, other contemporary artists will be reinterpreting each season through music.\r\n\r\nTo introduce the yearly collection and additional styles for Fall, Jamie Hawkesworth photographed the campaign while David Scearce wrote a captivating 11-minute short film both set in Tokyo which tells a story about different generations starring Kazuya Tanabe, Shun Sugata and underground tattoo artist TAPPEI.\r\n\r\nIn the campaign, Japan provides a clean, thoughtful, and exquisitely designed background to highlight a collection that has been refined through learnings from previous editions yet still retains its minimal silhouettes and patterns.\r\n\r\nA smart color palette of navy, black, grey, camel, and white features across high quality fabrics including leather, cashmere, alpaca, and cotton.\r\n\r\nThe search for this quintessential contemporary wardrobe has organically evolved into the sphere of homeware. Zara Origins began as an exercise to find the ideal white T-shirt or the purest denim pants and is now matched with equally refined lifestyle objects including drinking glasses, tableware, scents, and bathrobes among a wider offering.\r\n\r\nZara Origins will be available from 22 September 2022 on Zara.com and in selected stores.', 'Zara Origins — це проект, спрямований на створення сучасного гардеробу. Мета полягає в тому, щоб задумати, створити та пропонувати одяг, який є нещодавно вдосконаленим архетипом свого роду, виготовленим із найкращих матеріалів і виготовленим із дотриманням високих стандартів досвіду та майстерності. Він використовує прогресивний дизайн, щоб поєднати сучасні концепції з видатною цінністю.\r\n\r\nКоли Zara Origins випустила свої перші дві колекції для зимового та літнього сезонів, проект, що постійно розвивається, був визначений цією заявою. Після двох видань, які дозволили експериментувати всередині колекції, підхід до третього видання природним чином змінився, затвердивши Zara Origins як річну пропозицію основних предметів гардеробу, які будуть доповнені обмеженою серією сезонних виробів.\r\n\r\nЩоб доповнити новий підхід, креативне агентство M/M Paris розробило абсолютно нову графічну айдентику. Це включає новий шрифт і сім символів або імаготипів, які присутні в усьому брендингу, а також на частинах колекції. Ця графіка служить візуальною системою, що класифікує нову структуру цього проекту.\r\n\r\nПротягом усього процесу розробки нової колекції вічних предметів гардеробу, яка пропонує стилі, які можна носити протягом усіх місяців, «Чотири сезони» Антоніо Вівальді стали саундтреком і джерелом натхнення для проекту. Якщо композиція Aphex Twins «Avril 14th» була мелодією для першого видання, а «Sun is Shinning» Боба Марлі — опорою для другої композиції, то для третьої колекції електронний музикант Аокі Такамаса створив саундтрек для «Autumn». У майбутньому інші сучасні виконавці переосмислюватимуть кожен сезон за допомогою музики.\r\n\r\nЩоб представити щорічну колекцію та додаткові стилі на осінь, Джеймі Хоксворт сфотографував кампанію, а Девід Сірс написав захоплюючий 11-хвилинний короткометражний фільм, дія якого відбувається в Токіо, в якому розповідається про різні покоління, у головних ролях Кадзуя Танабе, Шун Сугата та підпільний тату-майстер ТАППІ.\r\n\r\nУ цій кампанії Японія пропонує чистий, продуманий і вишукано розроблений фон, щоб підкреслити колекцію, яка була вдосконалена завдяки вивченню попередніх випусків, але все ще зберігає свої мінімальні силуети та візерунки.\r\n\r\nРозумна колірна палітра темно-синього, чорного, сірого, верблюжого та білого кольорів поєднує високоякісні тканини, зокрема шкіру, кашемір, альпаку та бавовну.\r\n\r\nПошуки цієї квінтесенції сучасної гардеробу органічно переросли в сферу товарів для дому. Zara Origins починалася як вправа, щоб знайти ідеальну білу футболку чи найчистіші джинсові штани, а тепер поєднується з не менш вишуканими предметами стилю життя, включаючи склянки, столовий посуд, аромати та халати серед більшої пропозиції.\r\n\r\nZara Origins буде доступний з 22 вересня 2022 року на Zara.com і в окремих магазинах.', 'ZARA ORIGINS', 'ZARA ORIGINS'),
(4, 'Колекція Man Studio', 'Zara рада представити колекцію чоловічого одягу Zara Studio 2022 року з новою потужною кампанією та фільмом із номінантом на премію Оскар Коді Сміт МакФі в головній ролі. Харизматичний молодий австралійський актор номінований у категорії «Найкращий актор другого плану» за роль у фільмі «Влада собаки» на майбутній церемонії вручення «Оскарів». МакФі та творча команда Zara Studio вирушили до драматичних пустельних районів Йорданії, де під творчим керівництвом відомого модного іміджмейкера Фаб’єна Барона вони зняли фільм, а також кампанію, сфотографовану Девідом Сімсом.\r\n\r\nСміт МакФі був обраний для втілення цінностей і особливостей цієї останньої колекції Zara Studio. Колекції чоловічого та жіночого одягу Zara Studio, що випускаються раз на півроку, є найбільш направлено розробленими та матеріально піднесеними вираженнями моди в ширшому всесвіті Zara. Колекція, створена командою дизайнерів Zara Studio зі стилістом Карлом Темплером, є першим втіленням стилю Zara.\r\n\r\nНавесні 2022 року команда Studio досліджувала чоловічу територію, прикладом якої є скуйовджена елегантність Сміта МакФі на екрані. Оазис беззастережної прохолоди в ширшому просторі одягу, де домінує спортивний одяг, ця колекція Zara Studio передає потужну текучу та справжню богемність. Колекція базується на відтінках чорного вугілля з акцентами коричневого, бордового, сірого та гірчичного.\r\n\r\nВузький темний костюм із шалевим коміром грає на тлі приталених сорочки з стрілками, які носять із безтурботним шарфом. Вузькі штани чорного крою є основою незграбного силуету, доповненого черевиками «Челсі» та сорочкою з комбінованих матеріалів. Чорний трикотажний топ із широким вирізом, напівпрозорий, щоб повітря циркулювало біля тіла, поєднується зі шкіряними штанами, закріпленими ременем із карабінною пряжкою. Прикрашені дорогоцінними каменями срібні каблучки та ланцюжки з шармами додають додаткової яскравості. Паперовий лляний тренч насиченого гірчичного кольору додає повітряного, контрастного об’єму, а люрекс, замша та прозорі плівки збагачують видиму обробку та текстуру. Сльозинки пейслі відображені в золотистому бісері на сорочках і кафтанах і у вишивці на надлегкому атласному бомбері.\r\n\r\nЕлементарна, спокуслива та сильна, нова колекція чоловічого одягу Zara Studio передає душу мандрівника та впевнене та беззаперечно чуттєве втілення сучасної мужності.\r\n\r\n \r\n\r\nФотограф: Девід Сімс\r\n\r\nКіно та художній режисер: Фаб\'єн Барон\r\n\r\nМоделі: Kodi Smit-McPhee\r\n\r\nКерівництво колекції та стиль: Карл Темплер\r\n\r\nМакіяж: Даян Кендал\r\n\r\n Перукар: Гвідо Палау', '2022-10-25 10:06:57.215000', '2022-10-27 07:43:16.883000', 'photo/2022/10/25/1059a71e494e822ffcf493518330.jpg', 1, 'man-studio-collection', 2, 'Zara is pleased to premiere the 2022 Zara Studio menswear collection with a powerful new campaign and film starring the Academy Award nominee Kodi Smit McPhee. The charismatic young Australian actor is nominated in the Best Supporting Actor category for his performance in The Power of the Dog at the forthcoming Oscars ceremony. McPhee and the Zara Studio creative team travelled to the dramatic desert hinterlands of Jordan, where under the creative direction of renowned fashion image-maker Fabien Baron they shot the film, as well as a campaign photographed by David Sims.\r\n\r\nSmit McPhee was cast to embody the values and characteristics of this latest Zara Studio collection. Zara Studio’s biannual collections of menswear and womenswear are the most directionally designed and materially elevated expressions of fashion across the broader Zara universe. Created by the Zara Studio design team with stylist Karl Templer, the collection is Zara’s premiere articulation of style.\r\n\r\nFor Spring 2022 the Studio team explored a masculine territory that is exemplified by the tousled elegance of Smit McPhee’s broodingly mercurial screen presence. An oasis of unabashed cool in a wider clothing landscape dominated by sportswear, this Zara Studio collection transmits a powerfully fluid and debonair bohemianism. The collection is rooted in shades of black charcoal with accents of brown, burgundy, grey and mustard.\r\n\r\nSlim cut shawl collar dark suiting plays against fitted darted shirts worn with insouciantly trailing scarfing. Boot-cut slim pants in black are at the heart of an angular silhouette completed by Chelsea boots and mixed material henley shirting. A wide necked wide gauge black knit top, semi-sheer to allow the air to circulate against the body, is matched with leather pants secured by a carabinier buckle belt. Jewelled silver rings and charm-strung chains add an extra flash of hardware. A papery linen trench in deep mustard adds airy, contrasting volume while lurex, suede and transparencies enrich the vista of visible finish and texture. Paisley teardrops are played out in gold beading on shirting and kaftans and in embroidery on an ultralight satin bomber.\r\n\r\nElemental, seductive and strong, the new Zara Studio Menswear collection navigates the nomadic soul of a confident and unabashedly sensual articulation of modern masculinity.\r\n\r\n \r\n\r\nPhotographer: David Sims\r\n\r\nFilm and Art Direction: Fabien Baron\r\n\r\nModels: Kodi Smit-McPhee\r\n\r\nCollection direction and styling: Karl Templer\r\n\r\nMake up: Diane Kendal\r\n\r\n Hair stylist: Guido Palau', 'Zara рада представити колекцію чоловічого одягу Zara Studio 2022 року з новою потужною кампанією та фільмом із номінантом на премію Оскар Коді Сміт МакФі в головній ролі. Харизматичний молодий австралійський актор номінований у категорії «Найкращий актор другого плану» за роль у фільмі «Влада собаки» на майбутній церемонії вручення «Оскарів». МакФі та творча команда Zara Studio вирушили до драматичних пустельних районів Йорданії, де під творчим керівництвом відомого модного іміджмейкера Фаб’єна Барона вони зняли фільм, а також кампанію, сфотографовану Девідом Сімсом.\r\n\r\nСміт МакФі був обраний для втілення цінностей і особливостей цієї останньої колекції Zara Studio. Колекції чоловічого та жіночого одягу Zara Studio, що випускаються раз на півроку, є найбільш направлено розробленими та матеріально піднесеними вираженнями моди в ширшому всесвіті Zara. Колекція, створена командою дизайнерів Zara Studio зі стилістом Карлом Темплером, є першим втіленням стилю Zara.\r\n\r\nНавесні 2022 року команда Studio досліджувала чоловічу територію, прикладом якої є скуйовджена елегантність Сміта МакФі на екрані. Оазис беззастережної прохолоди в ширшому просторі одягу, де домінує спортивний одяг, ця колекція Zara Studio передає потужну текучу та справжню богемність. Колекція базується на відтінках чорного вугілля з акцентами коричневого, бордового, сірого та гірчичного.\r\n\r\nВузький темний костюм із шалевим коміром грає на тлі приталених сорочки з стрілками, які носять із безтурботним шарфом. Вузькі штани чорного крою є основою незграбного силуету, доповненого черевиками «Челсі» та сорочкою з комбінованих матеріалів. Чорний трикотажний топ із широким вирізом, напівпрозорий, щоб повітря циркулювало біля тіла, поєднується зі шкіряними штанами, закріпленими ременем із карабінною пряжкою. Прикрашені дорогоцінними каменями срібні каблучки та ланцюжки з шармами додають додаткової яскравості. Паперовий лляний тренч насиченого гірчичного кольору додає повітряного, контрастного об’єму, а люрекс, замша та прозорі плівки збагачують видиму обробку та текстуру. Сльозинки пейслі відображені в золотистому бісері на сорочках і кафтанах і у вишивці на надлегкому атласному бомбері.\r\n\r\nЕлементарна, спокуслива та сильна, нова колекція чоловічого одягу Zara Studio передає душу мандрівника та впевнене та беззаперечно чуттєве втілення сучасної мужності.\r\n\r\n \r\n\r\nФотограф: Девід Сімс\r\n\r\nКіно та художній режисер: Фаб\'єн Барон\r\n\r\nМоделі: Kodi Smit-McPhee\r\n\r\nКерівництво колекції та стиль: Карл Темплер\r\n\r\nМакіяж: Даян Кендал\r\n\r\n Перукар: Гвідо Палау', 'Man Studio Collection', 'Колекція Man Studio'),
(5, 'Колекція Rhuigi x Zara / RHU', 'Zara представляє нову колекцію, яка розбиває межі, у співпраці з дизайнером Руїгі Вілласеньором. RHU — абревіатура від Redesigning Human Uniform — виходить за межі традиційних кодів у чоловічому одязі, щоб забезпечити повну свободу самовираження через стиль. Ця смілива творча спроба також дає можливість власнику вийти за рамки загальноприйнятих понять «спортивний одяг», «розкіш» і «вуличний одяг».\r\n\r\nVillaseñor, засновник дизайнерського підприємства Rhude з Лос-Анджелеса, пояснив, що концепція RHU виникла природно від початку співпраці з Zara. Обидва бренди вирішили застосувати новий підхід. «Я завжди відчував сильну прихильність до створення якісних продуктів, які не визначаються ціною», — сказав він. Створення нового бренду RHU та партнерство з Zara, основною місією якої є створення якісних продуктів, що поєднують у собі якість і вартість, забезпечили платформу для реалізації бачення Villaseñor.\r\n\r\nVillaseñor задумав RHU як новий вид бренду спортивного одягу для нового покоління. Замість наголосу на рубежі століть на продуктивності як визначальній цінності спортивного одягу, він повертається до витоків Ліги плюща – основного кодексу одягу Америки – коли спортивний одяг був синонімом дозвілля, що відображає його центральну роль у здоров’ї, суспільства і творення мистецтва. Результатом стала колекція, яка рішуче відмовляється від зв’язування категоріями як основою для образів, у яких денім поєднується з універсальними штанами або сорочками в стилі мото та старими шкільними університетськими куртками з хохлами RHU. Базові легінси підшиті під спортивні шорти та доповнені курткою-сорочкою на ґудзиках із технічного нейлону, тоді як сорочка з абстрактним малюнком на ґудзиках поєднується з широкими бавовняними спортивними штанами з логотипом. Межа між формальністю та неформальністю фактично стирається. Колекція охоплює 57 предметів готового одягу RHU, шість стилів взуття RHU та шість сумок RHU.\r\n\r\n«Спадкоємцем спортивного відпочинку стане стиль одягу, де всі існуючі жанри розбиваються та змішуються, щоб сформувати щось набагато більш еклектично індивідуальне», — сказав Вілласеньор. «Ця колекція RHU — це моє вираження цього — відкритого, демократичного спортивного одягу.\r\n\r\nРедизайн Human Uniform — це розвиток до нового всеосяжного виразу спортивного одягу, натхненного духом і доступного для всіх. І я не можу придумати кращої компанії, з якою можна було б співпрацювати у створенні цього проекту, ніж Zara».', '2022-10-25 10:21:57.788000', '2022-10-27 07:42:14.495000', 'photo/2022/10/25/e1afbde04cadae4f274feb9da880.jpg', 1, 'rhuigi-x-zara-rhu-collection', 1, 'Zara presents a boundary-breaking new collection in collaboration with designer Rhuigi Villaseñor. RHU - the acronym for Redesigning Human Uniform - ventures beyond traditional codes in menswear to enable total freedom of expression through style. This bold creative endeavour also empowers the wearer to transcend conventional notions of ‘sportswear’, ‘luxury’ and ‘streetwear’.\r\n\r\nVillaseñor, the Los Angeles-based founder of design venture Rhude, explained that the concept for RHU came naturally from the beginning of the collaboration with Zara. Both brands decided to adopt a fresh approach. “I’ve always felt a strong affinity for creating well-made products that are not defined by price,” he said. Creating the new brand RHU and partnering with Zara - whose core mission is the creation of well-made products that combine both quality and value - provided a platform from which to realize Villaseñor vision.\r\n\r\nVillaseñor has conceived RHU as a new kind of sportswear brand for a new generation. Instead of the turn-of-the-century emphasis on performance as the defining value of sportswear, he looks back to the origins of Ivy League - America’s core clothing code - when sportswear was instead a synonym for leisure reflecting its central role in health, society and the creation of art. The result is a collection that resolutely declines to be bound by categories as the foundation for looks that play denim against utility pant, or moto inspired shirting against old school RHU-crested varsity jackets. Baselayer leggings are layered under sports shorts and styled with a button up shirt jacket in technical nylon, while abstract graphic button up shirting is paired with wide-leg logo track pants in cotton. The line between formality and informality is effectively erased. The collection spans 57 RHU ready to wear pieces, six RHU shoe styles, and six RHU bags.\r\n\r\n“The successor of athleisure is going to be a style of dressing where all the existing genres are broken down and mixed to shape something much more eclectically individual,” said Villaseñor. “This RHU collection is my expression of that - of open-source, democratic sportswear.\r\n\r\nRedesigning Human Uniform is about evolving towards a new inclusive expression of sportswear that’s inspired by spirit and is accessible to all. And I can’t think of a better company to have partnered with in building this project than Zara.”', 'Zara представляє нову колекцію, яка розбиває межі, у співпраці з дизайнером Руїгі Вілласеньором. RHU — абревіатура від Redesigning Human Uniform — виходить за межі традиційних кодів у чоловічому одязі, щоб забезпечити повну свободу самовираження через стиль. Ця смілива творча спроба також дає можливість власнику вийти за рамки загальноприйнятих понять «спортивний одяг», «розкіш» і «вуличний одяг».\r\n\r\nVillaseñor, засновник дизайнерського підприємства Rhude з Лос-Анджелеса, пояснив, що концепція RHU виникла природно від початку співпраці з Zara. Обидва бренди вирішили застосувати новий підхід. «Я завжди відчував сильну прихильність до створення якісних продуктів, які не визначаються ціною», — сказав він. Створення нового бренду RHU та партнерство з Zara, основною місією якої є створення якісних продуктів, що поєднують у собі якість і вартість, забезпечили платформу для реалізації бачення Villaseñor.\r\n\r\nVillaseñor задумав RHU як новий вид бренду спортивного одягу для нового покоління. Замість наголосу на рубежі століть на продуктивності як визначальній цінності спортивного одягу, він повертається до витоків Ліги плюща – основного кодексу одягу Америки – коли спортивний одяг був синонімом дозвілля, що відображає його центральну роль у здоров’ї, суспільства і творення мистецтва. Результатом стала колекція, яка рішуче відмовляється від зв’язування категоріями як основою для образів, у яких денім поєднується з універсальними штанами або сорочками в стилі мото та старими шкільними університетськими куртками з хохлами RHU. Базові легінси підшиті під спортивні шорти та доповнені курткою-сорочкою на ґудзиках із технічного нейлону, тоді як сорочка з абстрактним малюнком на ґудзиках поєднується з широкими бавовняними спортивними штанами з логотипом. Межа між формальністю та неформальністю фактично стирається. Колекція охоплює 57 предметів готового одягу RHU, шість стилів взуття RHU та шість сумок RHU.\r\n\r\n«Спадкоємцем спортивного відпочинку стане стиль одягу, де всі існуючі жанри розбиваються та змішуються, щоб сформувати щось набагато більш еклектично індивідуальне», — сказав Вілласеньор. «Ця колекція RHU — це моє вираження цього — відкритого, демократичного спортивного одягу.\r\n\r\nРедизайн Human Uniform — це розвиток до нового всеосяжного виразу спортивного одягу, натхненного духом і доступного для всіх. І я не можу придумати кращої компанії, з якою можна було б співпрацювати у створенні цього проекту, ніж Zara».', 'Rhuigi x Zara / RHU Collection', 'Колекція Rhuigi x Zara / RHU'),
(6, 'НАРЦИСО РОДРІГЕС x ZARA', 'Створення одягу завжди було глибоко особистим для американського дизайнера Нарцисо Родрігеза: «Моя сила — це мої тканини, мої майстерні, мої руки», — якось сказав він, — і результатом є самовладання, позачасовий, реалістичний і навіювальний. Ці якості, сама суть сучасної моди, тепер відзначаються Zara в спеціальній співпраці з Родрігезом, перспективою для жінок, які в захваті від його зовнішнього вигляду.\r\n\r\nХронологія видатної кар’єри Родрігеса охоплює понад 30 років і охоплює великий модний рух мінімалізму, ключовим архітектором якого він є. Його найвідомішим дизайном 1996 року стала весільна сукня, яку він пошив для своєї подруги Керолін Бессетт Кеннеді, така надзвичайно проста, що змінила весільний бізнес і продовжує залишатися іконою сучасного гламуру. Проте більшість робіт Родрігеса з часом стають все кращими.\r\n\r\n25 предметів одягу та аксесуарів у новому Narciso Rodriguez x Zara, взяті з його архіву, є тому підтвердженням. Хороший дизайн витримає.\r\n\r\n«Це був дивовижний досвід для мене, — говорить Родрігес про роботу із Zara. «Було чудово переглядати архів і переглядати речі, які нам подобалися. Також чудово бачити їх свіжими очима команди дизайнерів Zara.\r\n\r\nЦе така професійна команда, яка в захваті від кожного твору та дбає про збереження суті оригінальних творів».\r\n\r\nКолекція Narciso Rodriguez x Zara відображає як його гостре почуття архітектури, так і близькість, яку він встановив із тілом. Що робило сукню Rodriguez такою сексуальною не тому, що вона була облягаючою або відкритою, а тому, що тіло під ним завжди залишалося вільним. «У колекції є прекрасна сукня-кроєк і з цікавими швами, — зазначає він. «Це те, про що думають люди, коли думають про мій бренд. Він дуже рідкий. Він тече по тілу».\r\n\r\nВін також вказав на пальто з чорної дволицевої вовни з розрізами з боків і шкіряним поясом. «Пальто надзвичайне, воно таке ретельне». І дизайнер був щасливий, коли повернувся до життя штучний светр з високим горлом. Чорний трикотаж прозорий в деяких частинах і твердий в інших і має вбудований бюстгальтер.\r\n\r\n«Робота з Zara відкриває очі, тому що всі знають, що відбувається у світі та моді», — каже Родрігес. «У них дійсно ентузіасти, енергійні люди, і вони були в захваті від кожного аспекту цієї співпраці. І це було для мене весело — бачити людей, яких не було поруч, коли вперше показували цей одяг, тепер святкують і насолоджуються ним так само, як і ми 20 років тому».\r\n\r\nNarciso Rodriguez x Zara буде доступний з 8 вересня 2022 року на Zara.com і в окремих магазинах.', '2022-10-25 10:22:46.065000', '2022-10-27 07:42:36.901000', 'photo/2022/10/25/b7ef270c489c949d0d6c78fe416c.jpg', 1, 'narciso-rodriguez-x-zara', 3, 'Making clothes has always been deeply personal for the American designer Narciso Rodriguez—“My strength is my fabrics, my ateliers, my hands,” he  once said—and the result is a self-possessed style that is timeless, realistic and suggestive. Those qualities, the very essence of modern fashion, are  now being celebrated by Zara in a special collaboration with Rodriguez, a prospect for women thrilled for his look.\r\n\r\nThe timeline of Rodriguez’s remarkable career spans over 30 and encompasses the great fashion movement of minimalism, of which he is a  key architect. His best-known design, from 1996, was the wedding dress he made for his friend Carolyn Bessette Kennedy, a slip dress so ravishingly  simple it changed the bridal business and continues to be an icon of modern glamour. Yet, much of Rodriguez’s work gets better and better with time.\r\n\r\nThe 25 items of clothing and accessories in the new Narciso Rodriguez x Zara, all drawn from his archive, are proof of that. Good design endures.\r\n\r\n“This has been an amazing experience for me,” says Rodriguez of working with Zara. “It was great to go through the archive and revisit things that we loved. It also great to see them through Zara´s design team fresh eyes.\r\n\r\nThey are such a professional team excited about each piece and making sure the essence of the original ones are maintained.”\r\n\r\nThe Narciso Rodriguez x Zara collection reflects both his sharp sense of architecture and the intimacy he established with the body. What made a  Rodriguez dress so sexy was not that it was tight-fitting or revealing, but that the body underneath always remained free. “There’s a beautiful slip dress in the collection that’s bias-cut and with interesting seaming,” he notes. “It’s what people think of when they think of my brand. It’s very liquid. It flows  over the body.”\r\n\r\nHe also pointed to a wrap coat in black double-face wool with side slits and a leather sash belt. “The coat is extraordinary, it’s that meticulous.” And the  designer was happy to see an engineered turtleneck sweater come back to life. The black knit is sheer in parts and solid in others and has a built-in bra.\r\n\r\n“Working with Zara is eye-opening, because everyone is so aware of what’s going on in the world and in fashion,” Rodriguez says. “They have really enthusiastic, energetic people, and they were excited about every aspect of this collaboration. And that was fun for me—to see people who weren’t around when these clothes were first shown, now celebrating and enjoying them as much as we did 20 years ago.”\r\n\r\nNarciso Rodriguez x Zara will be available from 8 September 2022 on Zara.com and in selected stores.', 'Створення одягу завжди було глибоко особистим для американського дизайнера Нарцисо Родрігеза: «Моя сила — це мої тканини, мої майстерні, мої руки», — якось сказав він, — і результатом є самовладання, позачасовий, реалістичний і навіювальний. Ці якості, сама суть сучасної моди, тепер відзначаються Zara в спеціальній співпраці з Родрігезом, перспективою для жінок, які в захваті від його зовнішнього вигляду.\r\n\r\nХронологія видатної кар’єри Родрігеса охоплює понад 30 років і охоплює великий модний рух мінімалізму, ключовим архітектором якого він є. Його найвідомішим дизайном 1996 року стала весільна сукня, яку він пошив для своєї подруги Керолін Бессетт Кеннеді, така надзвичайно проста, що змінила весільний бізнес і продовжує залишатися іконою сучасного гламуру. Проте більшість робіт Родрігеса з часом стають все кращими.\r\n\r\n25 предметів одягу та аксесуарів у новому Narciso Rodriguez x Zara, взяті з його архіву, є тому підтвердженням. Хороший дизайн витримає.\r\n\r\n«Це був дивовижний досвід для мене, — говорить Родрігес про роботу із Zara. «Було чудово переглядати архів і переглядати речі, які нам подобалися. Також чудово бачити їх свіжими очима команди дизайнерів Zara.\r\n\r\nЦе така професійна команда, яка в захваті від кожного твору та дбає про збереження суті оригінальних творів».\r\n\r\nКолекція Narciso Rodriguez x Zara відображає як його гостре почуття архітектури, так і близькість, яку він встановив із тілом. Що робило сукню Rodriguez такою сексуальною не тому, що вона була облягаючою або відкритою, а тому, що тіло під ним завжди залишалося вільним. «У колекції є прекрасна сукня-кроєк і з цікавими швами, — зазначає він. «Це те, про що думають люди, коли думають про мій бренд. Він дуже рідкий. Він тече по тілу».\r\n\r\nВін також вказав на пальто з чорної дволицевої вовни з розрізами з боків і шкіряним поясом. «Пальто надзвичайне, воно таке ретельне». І дизайнер був щасливий, коли повернувся до життя штучний светр з високим горлом. Чорний трикотаж прозорий в деяких частинах і твердий в інших і має вбудований бюстгальтер.\r\n\r\n«Робота з Zara відкриває очі, тому що всі знають, що відбувається у світі та моді», — каже Родрігес. «У них дійсно ентузіасти, енергійні люди, і вони були в захваті від кожного аспекту цієї співпраці. І це було для мене весело — бачити людей, яких не було поруч, коли вперше показували цей одяг, тепер святкують і насолоджуються ним так само, як і ми 20 років тому».\r\n\r\nNarciso Rodriguez x Zara буде доступний з 8 вересня 2022 року на Zara.com і в окремих магазинах.', 'NARCISO RODRIGUEZ x ZARA', 'НАРЦИСО РОДРІГЕС x ZARA');
INSERT INTO `news_news` (`id`, `title`, `content`, `created_at`, `updated_at`, `photo`, `is_published`, `slug`, `category_id`, `content_en`, `content_uk`, `title_en`, `title_uk`) VALUES
(7, 'КАПСУЛЬНА СПІВПРАЦЯ', 'Незалежний британський бренд Studio Nicholson об’єднав зусилля з Zara, щоб представити переваги своєї торгової марки модульної шафи ширшій аудиторії. Запланований на 12 вересня 2022 року Studio Nicholson + Zara представляє компактну колекцію деконструйованої класичної чоловічої одягу. Використовуючи потужність глобального охоплення Zara, лондонський бренд Studio Nicholson може представити новим споживачам неперевершені переваги своєї позачасової функціональності.\r\n\r\nХороший дизайн має бути доступним для всіх. Це унікальне спільне партнерство обіцяє це завдяки колекції, в якій кожен предмет відповідає архетиповій формі Studio Nicholson простоти, цілеспрямованості та грайливої ​​гнучкості в культових формах бренду. Сильні, потужні силуети були викроєні до досконалості та розроблені для безтурботного пересування та багатошаровості в центрі міста.\r\n\r\nНічого не розбавили. Міжнародні зв’язки Zara дозволили засновнику та креативному директору Studio Nicholson Ніку Вейкману застосувати пуристичний підхід до цієї співпраці. З використанням лише тонких тканин та оригінального дизайну створена колекція є тріумфом галузі.\r\n\r\nГоворячи про своє рішення співпрацювати з одним із найуспішніших роздрібних торговців у світі, Нік Вейкман пояснила: «З моменту запуску студії Nicholson у 2010 році я поставив собі за мету створити модульну шафу, яка принесе комфорт, ясність і доречність у щоденних рішеннях. ми робимо, коли одягаємося. Одяг має покращувати наш настрій, рухатися, коли ми це робимо, і ніколи не виглядати застарілим. Підтримуючи цей дух протягом останніх дванадцяти років, я зрозумів, що працює, а що ні. Функціональність і тканина мають вирішальне значення.\r\n\r\nЯ підходжу до кожної нової колекції з такою ж суворістю, як архітектор проектує будівлю, і починаю з того, що фундамент міцно встановлений. Ця увага до деталей означала, що Studio Nicholson — це те, що може замовити не кожен. Співпраця із Zara означає, що модульні шафи відкриваються для нової захоплюючої демографії споживачів; люди, які, можливо, не мали можливості (ще) відчути бренд. Це дає нам канал для поширення естетики в регіонах і громадах, які, можливо, не бачили або не чули про нас раніше. Упродовж свого розвитку Zara зберігала надзвичайно високі редакторські цінності, і це робить їх ідеальним партнером для співпраці зі Studio Nicholson».\r\n\r\nКапсульна колекція з 12 частин включає взуття, окуляри та невеликі шкіряні вироби, а також ковдру. Палітра зберігає випробувані відтінки Studio Nicholson з несподіванкою графічних геометричних в’язаних елементів і яскравими сучасними кольорами. Верхній одяг із високоякісної шкіри в стилі преппі створює структуровану елегантність у поєднанні з типовими об’ємними штанами.\r\n\r\nЗавдяки кампанії, знятій у Нью-Йорку видатним британським фешн-фотографом Крейгом Макдіном, ця колекція доступна з 12 вересня 2022 року на Zara.com і в окремих магазинах.', '2022-10-25 10:24:04.946000', '2022-10-27 07:42:52.893000', 'photo/2022/10/25/Screenshot_32.png', 1, 'capsule-collaboration', 2, 'Independent British brand Studio Nicholson has combined forces with Zara to bring the merits of their trademark modular wardrobe to a wider audience. Due to launch 12 September 2022, Studio Nicholson + Zara presents a compact collection of deconstructed menswear classics. By harnessing the power of Zara’s global reach, the London-based Studio Nicholson brand can introduce the unrivalled benefits of their timeless functionality to new consumers.\r\n\r\nGood design should be accessible to all. This unique collaborative partnership promises this with a collection in which every item follows the archetypal Studio Nicholson form of simplicity, purpose and playful flexibility in the brand’s iconic shapes. Strong, powerful silhouettes have been cut to perfection and engineered for carefree movement and inner-city layering.\r\n\r\nNothing has been diluted. Zara’s international connections have enabled Studio Nicholson founder and creative director Nick Wakeman, to take a purist approach with this collaboration. Using only fine fabrics and original designs, the resulting collection is an industry triumph.\r\n\r\nSpeaking about her decision to partner with one of the world’s most successful retailers, Nick Wakeman explained, “Since launching Studio Nicholson in 2010, I’ve made it my aim to create a modular wardrobe that brings comfort, clarity and relevance to the daily decisions we make when we get dressed. Clothing should improve our mood, move when we do and never look outdated. Maintaining this ethos for the past twelve years has given me an insight into what works – and what doesn’t. Functionality and fabric are crucial.\r\n\r\nI approach every new collection with the same rigour as an architect designs a building – and begin by making sure the foundations are firmly in place. This attention to detail has meant that Studio Nicholson isn’t something that everyone can a ord. The collaboration with Zara means the modular wardrobe is exposed to an exciting new demographic of consumers; people who may not have had the chance (yet) to experience the brand. It gives us a channel to spread the aesthetic to regions and communities who might not have seen or heard of us before. Throughout their growth, Zara has retained extremely high editorial values and this makes them the ideal partner for a Studio Nicholson collaboration.”\r\n\r\nThe 12-part capsule collection includes footwear, eyewear and small leather goods, with the addition of a blanket. The palette retains the tried and tested Studio Nicholson hues with the surprise of graphic geometric knits and pops of contemporary colour. Modern preppy leather outerwear layers bring structured elegance teamed with the hallmark voluminous pants.\r\n\r\nWith a campaign shot in New York by the prominent British fashion photographer, Craig McDean, this collection is available from 12 September 2022 on Zara.com and in selected stores.', 'Незалежний британський бренд Studio Nicholson об’єднав зусилля з Zara, щоб представити переваги своєї торгової марки модульної шафи ширшій аудиторії. Запланований на 12 вересня 2022 року Studio Nicholson + Zara представляє компактну колекцію деконструйованої класичної чоловічої одягу. Використовуючи потужність глобального охоплення Zara, лондонський бренд Studio Nicholson може представити новим споживачам неперевершені переваги своєї позачасової функціональності.\r\n\r\nХороший дизайн має бути доступним для всіх. Це унікальне спільне партнерство обіцяє це завдяки колекції, в якій кожен предмет відповідає архетиповій формі Studio Nicholson простоти, цілеспрямованості та грайливої ​​гнучкості в культових формах бренду. Сильні, потужні силуети були викроєні до досконалості та розроблені для безтурботного пересування та багатошаровості в центрі міста.\r\n\r\nНічого не розбавили. Міжнародні зв’язки Zara дозволили засновнику та креативному директору Studio Nicholson Ніку Вейкману застосувати пуристичний підхід до цієї співпраці. З використанням лише тонких тканин та оригінального дизайну створена колекція є тріумфом галузі.\r\n\r\nГоворячи про своє рішення співпрацювати з одним із найуспішніших роздрібних торговців у світі, Нік Вейкман пояснила: «З моменту запуску студії Nicholson у 2010 році я поставив собі за мету створити модульну шафу, яка принесе комфорт, ясність і доречність у щоденних рішеннях. ми робимо, коли одягаємося. Одяг має покращувати наш настрій, рухатися, коли ми це робимо, і ніколи не виглядати застарілим. Підтримуючи цей дух протягом останніх дванадцяти років, я зрозумів, що працює, а що ні. Функціональність і тканина мають вирішальне значення.\r\n\r\nЯ підходжу до кожної нової колекції з такою ж суворістю, як архітектор проектує будівлю, і починаю з того, що фундамент міцно встановлений. Ця увага до деталей означала, що Studio Nicholson — це те, що може замовити не кожен. Співпраця із Zara означає, що модульні шафи відкриваються для нової захоплюючої демографії споживачів; люди, які, можливо, не мали можливості (ще) відчути бренд. Це дає нам канал для поширення естетики в регіонах і громадах, які, можливо, не бачили або не чули про нас раніше. Упродовж свого розвитку Zara зберігала надзвичайно високі редакторські цінності, і це робить їх ідеальним партнером для співпраці зі Studio Nicholson».\r\n\r\nКапсульна колекція з 12 частин включає взуття, окуляри та невеликі шкіряні вироби, а також ковдру. Палітра зберігає випробувані відтінки Studio Nicholson з несподіванкою графічних геометричних в’язаних елементів і яскравими сучасними кольорами. Верхній одяг із високоякісної шкіри в стилі преппі створює структуровану елегантність у поєднанні з типовими об’ємними штанами.\r\n\r\nЗавдяки кампанії, знятій у Нью-Йорку видатним британським фешн-фотографом Крейгом Макдіном, ця колекція доступна з 12 вересня 2022 року на Zara.com і в окремих магазинах.', 'CAPSULE COLLABORATION', 'КАПСУЛЬНА СПІВПРАЦЯ');
