(13, 'Віскозне плаття', 'viskozne-plattya', 1, '899', '40', '539', 'Сукня-сорочка з тканини з високим вмістом віскози.', 'класичний комір\r\nдовгі рукави з манжетами на ґудзиках\r\nзастібка на ґудзики\r\nрозрізи з боків', '1451C-69X', '', 20, '2022-10-12 04:13:18.287000', 2, 1, 1, 1, 'Shirt dress made of fabric with a high viscose content.', 'Сукня-сорочка з тканини з високим вмістом віскози.', '\"classic collar\r\nlong sleeves with button cuffs\r\nbutton fastening\r\nside slits\"', 'класичний комір\r\nдовгі рукави з манжетами на ґудзиках\r\nзастібка на ґудзики\r\nрозрізи з боків', 'Viscose dress', 'Віскозне плаття', 1, '5'),
(14, 'Viscose stylish dress', 'viskozne-stilne-plattya', 1, '899', '0', '899', 'Shirt dress made of fabric with a high viscose content.', '\"classic collar\nlong sleeves with button cuffs\nbutton fastening\ncuts from the sides\n\n\nModel height: 176 cm\n\nModel size S/36\"', '', '', 26, '2022-10-12 04:40:59.307000', 5, 1, 1, 2, 'Shirt dress made of fabric with a high viscose content.', 'Сукня-сорочка з тканини з високим вмістом віскози.', '\"classic collar\nlong sleeves with button cuffs\nbutton fastening\ncuts from the sides\n\n\nModel height: 176 cm\n\nModel size S/36\"', 'класичний комір\r\nдовгі рукави з манжетами на ґудзиках\r\nзастібка на ґудзики\r\nрозрізи з боків\r\n\r\n\r\nЗріст моделі: 176 cm\r\n\r\nНа моделі розмір S/36', 'Viscose stylish dress', 'Віскозне стильне плаття', 2, '5'),
(15, 'Джинсова дитяча сукня', 'dzhinsova-dityacha-suknya', 1, '699', '0', '699', 'Останнім часом розвиток нашої компанії став більш збалансованим. Використання більш екологічної сировини з сертифікованих джерел і застосування природозберігаючих технологій у процесі виробництва одягу дозволяє нам поступово знижувати вплив продукції на навколишнє середовище.', 'вузький комір\r\nвідрізна талія зі збіркою\r\nдекоративна стрічка', '', '', 5, '2022-10-12 04:42:49.630000', 4, 1, 1, 1, 'Recently, the development of our company has become more balanced. The use of more ecological raw materials from certified sources and the use of environmentally friendly technologies in the process of clothing production allow us to gradually reduce the impact of products on the environment.', 'Останнім часом розвиток нашої компанії став більш збалансованим. Використання більш екологічної сировини з сертифікованих джерел і застосування природозберігаючих технологій у процесі виробництва одягу дозволяє нам поступово знижувати вплив продукції на навколишнє середовище.', '\"narrow collar\ncut-out waist with assembly\ndecorative ribbon\"', 'вузький комір\r\nвідрізна талія зі збіркою\r\nдекоративна стрічка', 'Denim children\'s dress', 'Джинсова дитяча сукня', 0, '5'),
(16, 'Handbag made of artificial crocodile skin', 'sumochka-zi-shtuchnoyi-krokodilyachoyi-shkiri', 1, '999', '0', '999', 'zip closure\nextra pocket inside', 'Bag dimensions: 31 x 30 x 18 cm', '', '', 6, '2022-10-12 04:46:13.579000', 7, 1, 1, 2, 'zip closure\nextra pocket inside', 'застібка на блискавку\r\nдодаткова кишеня всередині', 'Bag dimensions: 31 x 30 x 18 cm', 'Розміри сумки: 31 x 30 x 18 cm', 'Handbag made of artificial crocodile skin', 'Сумочка зі штучної крокодилячої шкіри', 1, '3'),
(17, 'Бандажні бюстгальтери, 2 шт.', 'bandazhni-byustgalteri-2-sht', 1, '399', '0', '399', 'без застібки', 'склад головної тканини: 95% БАВОВНА, 5% ЕЛАСТАН', '', '', 5, '2022-10-12 04:50:11.129000', 8, 1, 1, 1, 'without a clasp', 'без застібки', 'composition of the main fabric: 95% COTTON, 5% ELASTAN', 'склад головної тканини: 95% БАВОВНА, 5% ЕЛАСТАН', 'Bandage bras, 2 pcs.', 'Бандажні бюстгальтери, 2 шт.', 0, '5'),
(18, 'Трикотажна водолазка', 'trikotazhna-vodolazka', 1, '399', '0', '399', 'Водолазка обтислого крою з м’якого трикотажу з високим вмістом віскози.', 'комір-гольф\r\n\r\n\r\nЗріст моделі: 178 cm\r\n\r\nНа моделі розмір S/36', '', '', 10, '2022-10-12 04:54:48.032000', 6, 1, 1, 9, 'Slim fit turtleneck made of soft knitwear with a high viscose content.', 'Водолазка обтислого крою з м’якого трикотажу з високим вмістом віскози.', '\"collar-golf\n\n\nModel\'s height: 178 cm\n\nModel size S/36\"', 'комір-гольф\r\n\r\n\r\nЗріст моделі: 178 cm\r\n\r\nНа моделі розмір S/36', 'Knitted turtleneck', 'Трикотажна водолазка', 2, '4'),
